import { Component } from 'react';

class TOC extends Component {
  constructor(props) {
    super(props);
    

    this.state = {
      
    }
  }
    render() {

      let list;
      
      for (let i = 0; i < this.props.contents.length; i++) {
        
        list += <li><a href={this.props.contents[0].id + '.html'}
        onClick={(e) => {
          this.props.onChangePage('html');
          e.preventDefault();
        }}>{this.props.contents[0].title}</a></li>
        
      }

      return (
        <nav>

        <ul>{list}</ul>

        </nav>
      );
    }
  }

export { TOC };
